message:
The American people are thirsting. 

They're thirsting for a President who will stand up and fight the Washington Machine. 

They rise up in droves to join my campaign when they hear my message of: 

>>> Cutting spending and tackling our soaring $18.2 TRILLION debt; 

>>> Repealing ObamaCare 100%; 

>>> Breaking the career politicians' grip on Washington by passing term limits; 

>>> Enacting massive tax cuts for every American like our nation hasn't seen in almost 35 years, all designed to get our economy moving again; 

>>> Ending unconstitutional NSA spying on innocent American citizens. 

Can I count on you to chip in before tomorrow's midnight deadline to help me get our Liberty message out to as many voters as possible across the country?

Please take a moment today to think about and reflect  upon the sacrifices made in our name.    To all those who made the ultimate sacrifice, we honor your memory.  

"Cover them over with beautiful flowers,
Deck them with garlands, those brothers of ours,
Lying so silent by night and by day
Sleeping the years of their manhood away.
Give them the meed they have won in the past;
Give them the honors their future forcast;
Give them the chaplets they won in the strife;
Give them the laurels they lost with their life."                     -- Will Carleton
